import { useNavigate } from 'react-router-dom';


export const Main = () => {   
     const Navigate = useNavigate();
    return (
        <div> 
            <div>/</div>
            <button onClick={<Navigate to="/Sum" />}> clickMe  </button>
        </div>
    );
}
